import React from "react";
class Header extends React.Component{
  
  render(){
    var titles=[
        {
          id:1,
          name:'Home',
          status: true
        },
        {
          id: 2,
          name:'Category',
          status:false
        },
        {
          id:3,
          name:'Contact',
          status:false
        },
        {
          id: 4,
          name:'More',
          status: false
        }
      ];
    let elements= titles.map((title,index)=>{
        let result='';
        if(title.status){
            result = <li className="active"><a href="#/">{title.name}</a></li>
        }else{
            result = <li ><a href="#/">{title.name}</a></li>
        }
        return result;
    });
      return(
          <div>
              
              <nav className="navbar navbar-inverse">
                  <a className="navbar-brand"  href="#/">Kengan Nogul</a>
                  <ul className="nav navbar-nav">
                      {elements}
                  </ul>
              </nav>
              
              
          </div>
      );
  }
}
export default Header;
